// FormSection.js
import React from 'react';

const FormSection = ({ formData, handleInputChange }) => {
  return (
    <div>
      <label>
        Name:
        <input type="text" name="name" value={formData.name || ''} onChange={(e) => handleInputChange('name', e.target.value)} />
      </label>
      <br />
      <label>
        Age:
        <input type="number" name="age" value={formData.age || ''} onChange={(e) => handleInputChange('age', e.target.value)} />
      </label>
      <br />
    </div>
  );
};

export default FormSection;
